import React from 'react'
import {connect, ConnectedProps} from 'react-redux'
import {ProfileEdit} from './ProfileEdit'
import {
    GetCountries,
    GetProfiles,
    GetDocuments,
    updateManufacturer,
    updateDocument,
    postDocument,
    GetCategory
} from '../../../../redux/reducers/ProfileReducer'
import {AppStateType} from "../../../../redux/redux_store";

export type CategoriesType = Array<{
        id: number,
        Name: string
    }>

type RootProps = {
    GetProfiles: () => void,
    GetCountries: () => void,
    GetDocuments: () => void,
    GetCategory: () => void,
    countries: Array<any>
    category: Array<{
        id: number,
        Name: string
    }>,
    profile: Array<{
        id: number,
        companyProfilePicture: string,
        companyName: string,
        companyDescription: string,
        country: string,
        companyLogo: string,
        sections: string,
        owner: number
    }>
    postDocument: (userID: number) => void
    previousProfile: Array<{
        id: number,
        companyProfilePicture: string,
        companyName: string,
        companyDescription: string,
        country: string,
        companyLogo: string,
        sections: string,
        owner: number
    }>,
    userID: number,
    documents: Array<{
        id: number,
        Title: string,
        Thumbnail: string,
        Download: string,
        owner: number
    }>,
    updateManufacturer: (form_data: any, id: number) => void,
    updateDocument: (form_doc_data: any, id: number) => void

}

class ProfileEditContainer extends React.PureComponent<RootProps> {
    componentDidMount() {
        debugger
        this.props.GetProfiles()
        this.props.GetCountries()
        this.props.GetDocuments()
        this.props.GetCategory()
    }

    render() {
        return this.props.profile.length !== 0 ?
            <ProfileEdit category={this.props.category} postDocument={this.props.postDocument}
                          updateDocument={this.props.updateDocument}
                         updateManufacturer={this.props.updateManufacturer} documents={this.props.documents}
                         userID={this.props.userID} previousProfile={this.props.profile}
                         countries={this.props.countries}/> : <div>Loading</div>
    }
}

let mapStateToProps = (state: AppStateType) => {
    debugger
    return {
        countries: state.profile.countries,
        userID: state.auth.user.id,
        profile: state.profile.profiles,
        documents: state.profile.documents,
        category: state.profile.category
    }
}



export default connect(mapStateToProps, {
    GetCountries,
    GetProfiles,
    GetCategory,
    GetDocuments,
    updateManufacturer,
    postDocument,
    updateDocument
})(ProfileEditContainer)
